import {Nav, Header, Grommet,Anchor } from 'grommet';

export const AppBar = (props) => {
    return(
        <Grommet theme={grommet}>
    <Header background="light-4" pad="small">
     
      <Nav direction="row">
        <Anchor label="Home" href="#" />
        <Anchor label="Profile" href="#" />
      </Nav>
    </Header>
  </Grommet>
    )
}
